import PropTypes from 'prop-types';


export default function Button({ 
    children,
    primary,
    secondary,
    success,
    warning,
    danger,
    outline,
    rounded,
}) {

    return (
        <div>
            <button className='px-3 py-1.5 border broder-blue-600 bg-blue-500 text-white '> {children} </button>
        </div>
    )
}

Button.propTypes = {
    checkVariationValue: ({primary, secondary, warning,success,danger}) => {
        const count = 
            Number(!!primary) +
            Number(!!secondary) +
            Number(!!warning) +
            Number(!!success) +
            Number(!!danger);

        if (count > 1) {
            throw new Error(
                'Only one of primary, secondary, success, warning, danger can be true'
            );
        }
    }
};
